import React from 'react';
import './Gift.css'

const Gift = () => {
    return (<>
        <main>
            <div className="container-fluid d-flex justify-content-center align-items-center flex-column" id="Main">
                <h4>Send Gold to your loved ones online in just a few clicks</h4>
                <button className="btn">Send your first gift <i className="fas fa-arrow-right"></i></button>
            </div>
        </main>
    </>);
}

export default Gift;
